"use client";
import React,{ useState, useEffect } from "react";
import Image from "next/image";
import {Divider,Button,Space,Watermark,Card,Row,Col,Form,Spin,notification,ConfigProvider} from "antd";
import { LoadingOutlined } from '@ant-design/icons';


interface Attribute {
  type: string;
  image: string;
  label: string;
  item: string;
}
interface DataSource {
  line_id: number;
  attribute: Attribute[];
}

const data: DataSource[] = [
  {
    line_id: 4,
    attribute: [
      {
        type: "part",
        image:
          "data:image/jpeg;base64,",
        label: "125A",
        item: "TG000000-125A",
      },
      {
        type: "part",
        image:
          "data:image/jpeg;base64,",
        label: "159A",
        item: "TG000000-159A",
      },
      {
        type: "part",
        image:
          "data:image/jpeg;base64,",
        label: "4420",
        item: "TG000000-4420",
      },
      {
        type: "part",
        image:
          "data:image/jpeg;base64,",
        label: "1330",
        item: "TG000000-1330",
      },
      {
        type: "part",
        image:
          "data:image/jpeg;base64,",
        label: "122X",
        item: "TG000000-112X",
      },
      {
        type: "box",
        image:
          "data:image/jpeg;base64,",
        label: "30",
        item: "Grey box 30 pcs.",
      },
      {
        type: "box",
        image:
          "data:image/jpeg;base64,",
        label: "10",
        item: "Grey box 10 pcs.",
      },
      {
        type: "box",
        image:
          "data:image/jpeg;base64,",
        label: "5",
        item: "Green box 5 pcs.",
      },
      {
        type: "box",
        image:
          "data:image/jpeg;base64,",
        label: "2",
        item: "Green box 2 pcs.",
      },
    ],
  },
];

interface OrderData {
  line_id: number;
  part_model: string | null;
  empty_box_type: string | null;
  order_type: number;
}

const dataSubmitted = [
  {
    line_id: 4,
    task_queue: "2 queues",
    status: "Moving to Slip ring 3rd",
    estimate_time_arrival: "3 minutes...",
    duration: "2023-08-10 15:36:20.523476+07",
  },
];

const FirstDesign: React.FC = () => {
  const [form] = Form.useForm<OrderData>();
  const [selectedModel, setSelectedModel] = useState<Attribute | null>(null);
  const [selectedBoxType, setSelectedBoxType] = useState<Attribute | null>(null);
  const [taskQueue, setTaskQueue] = useState("");
  const [status, setStatus] = useState("");
  const [estimateTime, setEstimateTime] = useState("");
  const [loading, setLoading] = useState<boolean>(false);

  const handleCardClick = (attr: Attribute) => {
    if (attr.type === "part") {
      if (selectedModel) {
        setSelectedModel(null);// If the clicked part card is already selected, deselect it
      } else {// Otherwise, select the clicked part card
        setSelectedModel(attr);
      }
    } else if (attr.type === "box") {
      if (selectedBoxType) {
        setSelectedBoxType(null);// If the clicked box card is already selected, deselect it
      } else {// Otherwise, select the clicked box card
        setSelectedBoxType(attr);
      }
    }
  };

  const handleOrderClick = () => {
    let orderType = 0; // Default order type
  
    if (selectedModel && selectedBoxType) {
      orderType = 1; // Case 1: Both part model and empty box type selected
    } else if (selectedModel) {
      orderType = 2; // Case 2: Only part model selected
    } else if (selectedBoxType) {
      orderType = 3; // Case 3: Only empty box type selected
    }
  
    form.setFieldsValue({
      line_id: data[0].line_id,
      part_model: selectedModel?.item ?? null,
      empty_box_type: selectedBoxType?.item ?? null,
      order_type: orderType,
    });
  
    const submittedData = dataSubmitted.find(
      (item) => item.line_id === data[0].line_id
    );
  
    if (submittedData) {
      setTaskQueue(submittedData.task_queue);
      setStatus(submittedData.status);
      setEstimateTime(submittedData.estimate_time_arrival);
    }
  
    form.submit(); // Submit the form
  };

  return (
    
    <div
      style={{ /*border: "solid 5px blue",*/ display: "flex" }}
      className="box1"
    >
      <Form
        form={form}
        // onFinish={handleOrderClick}
        // onFinish={(v) => {
        //   console.log(v);
        // }}
      >
        <div
          /*Left side */ style={{
            // border: "solid 1px red",
            display: "flex",
            flexDirection: "column",
            width: "50vw",
          }}
        >
          <div
            /*Supply Model Div */ style={
              {
                // border: "1px solid orange",
              }
            }
            className="part-model-section"
          >
            <div style={{ padding: "2rem", marginLeft: "30px" }}>
              <h1>Supply Model</h1>
              <p>Please select your supply model that you want.</p>
            </div>
            <div
              /*Box Components */ style={{
                display: "felx",
                justifyContent: "center",
                overflow: "scroll",
                overflowX: "hidden",
              }}
            >
              {/* <Form.Item
                name="line_id"
                className="formid"
                style={{ height: 0 }}
              />
              <Form.Item name="order_type"/> */}
              <Form.Item name="part_model" style={{ justifyContent: "center" }}>
                <Row
                  gutter={[16, 16]}
                  style={{
                    display: "flex",
                    height: "160px",
                    width: "100%",
                    justifyContent: "center",
                  }}
                >
                  {data[0].attribute.map((attr) => {
                    if (attr.type === "part") {
                      return (
                        <Col key={attr.label} xs={24} sm={12} md={8} lg={5}>
                          <Card
                            hoverable
                            className={`card ${
                              selectedModel &&
                              selectedModel.label === attr.label
                                ? "selected"
                                : ""
                            }`}
                            onClick={() => handleCardClick(attr)}
                            style={{
                              borderRadius: "7px",
                              height: "150px",
                              textAlign: "center",
                            }}
                          >
                            <div
                              style={{
                                width: "100%",
                                height: "50px",
                                textAlign: "center",
                              }}
                            >
                              <Image
                                src={attr.image}
                                alt={attr.label}
                                layout="responsive"
                                objectFit="cover"
                                width={500}
                                height={500}
                              />
                            </div>
                            <strong>{attr.label}</strong>
                          </Card>
                        </Col>
                      );
                    }
                  })}
                </Row>
              </Form.Item>
            </div>
          </div>
          <div
            /*Empty Box Type Div */ style={
              {
                // height: "40vh",
                // border: "1px solid green",
              }
            }
            className="empty-box-type-section"
          >
            <div style={{ padding: "1rem", marginLeft: "30px" }}>
              <h1>Empty Box Type</h1>
              <p>Please select your empty box type that you want.</p>
            </div>
            <div
              /*Box Components */ style={{
                padding: "2rem",
                paddingTop: "1rem",
                paddingLeft: "5rem",
                overflow: "scroll",
                overflowX: "hidden",
              }}
            >
              <Form.Item name="empty_box_type">
                <Row
                  gutter={[16, 16]}
                  style={{
                    height: "140px",
                    width: "100%",
                    justifyContent: "center",
                  }}
                >
                  {data[0].attribute.map((attr) => {
                    if (attr.type === "box") {
                      return (
                        <Col
                          key={attr.label}
                          xs={24}
                          sm={12}
                          md={8}
                          lg={6}
                          xl={6}
                        >
                          <Card
                            hoverable
                            className={`card ${
                              selectedBoxType &&
                              selectedBoxType.label === attr.label
                                ? "selected"
                                : ""
                            }`}
                            onClick={() => handleCardClick(attr)}
                            style={{
                              borderRadius: "7px",
                              height: "150px",
                              textAlign: "center",
                            }}
                          >
                            <div style={{ width: "100%", height: "100px" }}>
                              <Image
                                src={attr.image}
                                alt={attr.label}
                                layout="responsive"
                                width={300}
                                height={300}
                              />
                            </div>
                            {attr.label}
                          </Card>
                        </Col>
                      );
                    }
                  })}
                </Row>
              </Form.Item>
            </div>
          </div>
          <div
            /*button */ style={{
              // border: "1px solid red",
              display: "flex",
              justifyContent: "flex-end",
              alignItems: "center",
              marginRight: "3rem",
            }}
          >
            <Space wrap>
              <Button
                size="large"
                type="primary"
                disabled={!(selectedModel || selectedBoxType)}
                onClick={handleOrderClick}
                style={{ width: "150px", height: "80px" }}
              >
                Order
              </Button>
            </Space>
          </div>
        </div>
      </Form>
      <Divider type="vertical" style={{ height: "100%", borderWidth: 3 }} />
      <div
        /*Right side */ style={{
          // border: "solid 1px green",
          width: "50vw",
          display: "flex",
          flexDirection: "column",
        }}
      >
        <div style={{height: "20vh",padding: "2rem",paddingTop: "3rem",marginLeft: "20px",}}>
          <p style={{ fontSize: "25px" }}>Task Queue :{' '}<strong>{loading ? <Spin indicator={<LoadingOutlined/>} /> : taskQueue}</strong></p>
          <p style={{ fontSize: "25px" }}>Status :{' '}<strong>{loading ? <Spin indicator={<LoadingOutlined/>} /> : status}</strong></p>
          <p style={{ fontSize: "25px" }}>Estimate Time Arrive : {' '}<strong>{loading ? <Spin indicator={<LoadingOutlined/>} /> : estimateTime}</strong></p>
        </div>
        <div
          /*Path */ style={{
            /*border: "1px solid cyan",*/ height: "63vh",
            position: "relative",
          }}
        >
          <div
            style={{
              top: "50px",
              right: "50px",
              left: "50px",
              bottom: "10px",
              border: "1px dashed #c0c7d1",
              position: "absolute",
            }}
          >
            <Watermark
              content={["PE-DX", "Tech Innovation"]}
              gap={[23, 23]}
              height={30}
              width={50}
            >
              <div style={{ position: "relative", height: 400 }} />
            </Watermark>
          </div>
        </div>
        <div style={{ textAlign: "center" }}>
          <p>MiR API Path</p>
        </div>
      </div>
    </div>
  );
};

export default FirstDesign;
